import React from "react";
import {slide as Menu} from "react-burger-menu";

export default props => {
    return (
        // Pass on our props
        <Menu {...props}>

            {props.userStatus !== 1 ? <a className="menu-item" href="./NavigateTheChief.js">
                    Ana Ekran
                </a>
                :

                <a className="menu-item" href="./PersonelNavigation.js">
                    Ana Ekran
                </a>
            }

            {
                props.userStatus !== 1 &&
                <a className="menu-item" href="./PreviousPermissions.js">
                    Personel İzin Talepleri
                </a>
            }
            <button onClick={()=>{
                this.props.history.push({
                    pathname: '/PersonelScreens/FillingThePermissionForm'
                })
            }}>
            <a className="menu-item">
                İzin Yaratma Ekranı
            </a>
            </button>

            <a className="menu-item" href="./PreviousPermissions.js">
                İzinlerimi Göster
            </a>
        </Menu>
    );
};
